import {BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import './App.css';
import Login from './Containers/Login';

function App() {
  return (

    <Router>
      <Routes>
        <Route exact path='/login' component={Login}></Route>
    </Routes>
    </Router>

  );
}

export default App;
